import styles from './SeeMore.module.scss';
import { useState } from 'react';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faA, faQuestionCircle, faKeyboard } from '@fortawesome/free-solid-svg-icons';
import Proper from '../Proper';
function SeeMore() {
    const [listSeeMore] = useState([
        { text: 'English', iconSeeMore: faA },
        { text: 'Feedback and help', iconSeeMore: faQuestionCircle },
        { text: 'Keyboard shortcuts', iconSeeMore: faKeyboard },
    ]);

    const renderListSeeMore = () => {
        return (
            listSeeMore.map((seeMore, index) => {
                return (
                    <Proper key={index} searchValue={seeMore.text} icon={seeMore.iconSeeMore} />
                );
            })
        )
    }

    return (
        <div className={styles['wrapper']}>
            {
                renderListSeeMore()
            }
        </div>
    );
}

export default SeeMore;
